import React from 'react';
import './NotFound.css'; 

function NotFound() {
  return (
    <div className='NotFound'>
      <div className='meta'>404</div>
      <div className='head' />
      <p className='message'>Page Not Found</p>
    </div>
  );
}

export default NotFound;
